import React from 'react';
import ReactDOM from 'react-dom';
import App from './App.js';
import robots from './robots.js';
//import * as serviceWorker from './serviceWorker';

ReactDOM.render(
    <
      App 
    id={robots[0].id} 
    name={robots[0].name} 
    email={robots[0].email}
    /> ,
  document.getElementById('root')
);

